import "./Navbar.css"

const Navbar = () => {
    var navbar = document.getElementsByClassName("Navbar");


    window.onscroll = () => { console.log(navbar) };

    

    return (
        <div className="Navbar">
            <div className="LogoBox">
                <img className="LogoImage"/>
            </div>
            <div className="UBox">
                <ul>
                    <li>In√≠cio</li>
                    <li>Eventos</li>
                    <li>Contato</li>
                    <li>Quem somos</li>
                </ul>
            </div>
        </div>
    );

}

export default Navbar;
